        <i><svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M17.002 17.1844L22.3176 22.5001M19.6934 10.6874C19.6934 15.7615 15.58 19.8749 10.5059 19.8749C5.43174 19.8749 1.31836 15.7615 1.31836 10.6874C1.31836 5.61326 5.43174 1.49988 10.5059 1.49988C15.58 1.49988 19.6934 5.61326 19.6934 10.6874Z" stroke="#CDA274" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round"/></svg>                </i>
   </div>
</section>
  )
}

